(14275, '2025-2', 8, 44, 'Catedra', '222', 'NN', NULL, NULL, '8.0', '0.0', 'Popayán', 'no', 'no', NULL, NULL, 'adicionar', '3.50', '4-31/164\r\nPopayán, 12 de mayo de 2025\r\nUna vez realizado el estudio de vinculación de temporales y basados en las necesidades académicas para el periodo 2025-2 y teniendo en cuenta la responsabilidad presupuestal que nos asiste, comedidamente le informo que no es posible aceptar la solicitud de vinculación de profesores temporales propuesto por el Departamento de Estructuras, porque cuatro (4) Ocasionales Medio Tiempo se modifican a Tiempo Completo y la reducción de 1 cátedra 8 horas cátedra no compensa presupuestalmente dicho cambio, (comparación realizada con el periodo 2025-1), por lo tanto, le solicito comedidamente revisar y modificar la labor y vinculación de los profesores temporales con los que cuenta éste departamento a la fecha y remita el ajuste de vinculación 2025-2 de manera prioritaria.', 'Otro', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(14276, '2025-2', 8, 46, 'Catedra', '65748419', 'MEDINA BELLO ENIF', '', '', '0.0', '8.0', 'Regionalización', 'no', 'no', NULL, NULL, 'adicionar', '3.00', '4-31/165\nPopayán, 12 de mayo de 2025\nAsunto: Requerimiento solicitud de vinculación temporales 2025-2\n\nCordial saludo,\n\nUna vez realizado el estudio de vinculación de temporales y basados en las necesidades académicas para el periodo 2025-2 y teniendo en cuenta la responsabilidad presupuestal que nos asiste, comedidamente le informo que no es posible aceptar la solicitud de vinculación de profesores temporales propuesto por el Departamento de Hidráulica, porque incrementan un (1) Ocasional Tiempo Completo y la reducción de un (1) cátedra y 4 horas no compensa presupuestalmente dicho cambio, (comparación realizada con el periodo 2025-1), por lo tanto, le solicito comedidamente revisar y modificar la labor y vinculación de los profesores temporales con los que cuenta éste departamento a la fecha y remita el ajuste de vinculación 2025-2 de manera prioritaria.', 'Otro', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(14277, '2025-2', 2, 4, 'Catedra', '222', 'NN', NULL, NULL, '8.0', '0.0', 'Popayán', 'no', 'no', NULL, NULL, 'adicionar', '3.50', '4-31/161 Popayán, 9 de mayo de 2025\r\nno es posible aceptar la solicitud de vinculación de profesores temporales propuesto por el Departamento de Agroindustria, porque incrementan 1 Ocasional Tiempo Completo y una disminución de 8 hrs. cátedra no compensa presupuestalmente la nueva vinculación', 'Otro', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
